import React from 'react'
import "./css/widget.css"
import InfoIcon from '@mui/icons-material/Info';
function widget() {
  return (
    <div className='widget'>
        <div className='widget__top'>
            <div className='widget__header'>
                <h4>Skillop News</h4>
                <InfoIcon/>
            </div>
        </div>
    </div>
  )
}

export default widget
